import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import HomePage from './pages/HomePage'; // Pretpostavljamo da je HomePage.js u src/pages folderu
import ServicePage from './pages/ServicePage'; // Pretpostavljamo da je ServicePage.js u src/pages folderu
import DoctorProfilePage from './pages/DoctorProfilePage'; // Import komponente za profil doktora
import LoginPage from './pages/LoginPage'; // Import komponente za login
import SignUpPage from './pages/SignUpPage'; // Import nove komponente za registraciju

function App() {
  return (
    <Router>
      <div className="App">
        {/* Globalni stilovi za navigaciju, ako su potrebni */}
        <style>
          {`
          .nav-link {
            color: black !important; /* Crna boja za neaktivne linkove */
          }
          .nav-link.active {
            color: #e91e63 !important; /* Roza boja za aktivni link */
            font-weight: bold; /* Opcija: podebljajte aktivni link */
          }
          .nav-link:hover {
            color: #e91e63 !important; /* Roza boja pri prelasku mišem */
          }
          /* Stil za sticky header */
          .sticky-header {
            position: sticky;
            top: 0;
            z-index: 1020; /* Veći z-index da bude iznad ostalog sadržaja */
            width: 100%;
            background-color: white; /* Osigurajte pozadinu da se ne vidi sadržaj ispod */
          }
          `}
        </style>

        {/* Header je sada dio App.js jer je zajednički za sve stranice */}
        <header className="d-flex justify-content-between align-items-center py-3 px-4 bg-white shadow-sm sticky-header">
          <h1 className="h3 mb-0 text-danger">WinxCare</h1>
          <nav>
            <ul className="nav">
              <li className="nav-item">
                {/* Koristimo Link umjesto a tagova */}
                <Link className="nav-link" to="/">Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/service">Service</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/contact-us">Contact Us</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/help">Help</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/blogs">Blogs</Link>
              </li>
            </ul>
          </nav>
          <div className="d-flex">
            {/* Dodajemo linkove za Sign Up i Log In */}
            <Link to="/sign-up" className="btn btn-outline-danger me-2">Sign Up</Link>
            <Link to="/login" className="btn btn-danger">Log In</Link>
          </div>
        </header>

        {/* Routes definira koje komponente se renderuju na kojim rutama */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/service" element={<ServicePage />} />
          {/* Ruta za profil doktora */}
          <Route path="/doctor/:id" element={<DoctorProfilePage />} />
          {/* Ruta za Login stranicu */}
          <Route path="/login" element={<LoginPage />} />
          {/* Ruta za Sign Up stranicu */}
          <Route path="/sign-up" element={<SignUpPage />} />
          {/* Dodajte rute za Forgot Password ako ih kreirate */}
          <Route path="/forgot-password" element={
            <div className="container text-center py-5">
              <h2 className="text-danger">Forgot Password Page</h2>
              <p>Implementirajte logiku za resetovanje lozinke ovdje.</p>
            </div>
          } />
          <Route path="/contact-us" element={<div><h1>Contact Us Page</h1></div>} />
          <Route path="/help" element={<div><h1>Help Page</h1></div>} />
          <Route path="/blogs" element={<div><h1>Blogs Page</h1></div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
